import React, { Component } from "react";
import auth from "../../services/authService";
import { logoutSuccess } from "../../store/auth";

class Logout extends Component {
  state = {};

  componentDidMount() {
    auth.logout();
    window.location = "/";
  }

  render() {
    return null;
  }
}

export default Logout;
